class OperatorService{constructor(){}registerUser(n){return base_axios.post(API_REGISTER_OPERATOR,n)}loginUser(n){return base_axios.post(API_LOGIN,n)}getCurrentUser(){return base_axios.get(API_GET_CURRENT_OPERATOR)}signOutUser(){return base_axios.post(API_SIGNOUT)}getById(n){return base_axios.get(`${API_OPERATOR_CRUD}/${n}`)}save(n){return base_axios.post(`${API_OPERATOR_CRUD}`,n)}update(n,t){return base_axios.put(`${API_OPERATOR_CRUD}/${n}`,t)}}